The Toronto subway and RT is a rapid transit system in Toronto, Ontario, Canada, consisting of both underground and elevated railway lines, operated by the Toronto Transit Commission (TTC). It was Canada's first completed subway system, with the first line being built under Yonge Street, which opened in 1954 with 12 stations. Since then, the system has expanded to become Canada's largest rapid transit rail network and the second busiest, behind the Montreal Metro, in number of daily ridership, encompassing four lines and 69 stations on 70 kilometres (43 mi) of track. The subway system is a very popular mode of public transport in Toronto, with an average of 948,100 passenger trips each weekday (as of Q1 2010).

The TTC sometimes uses the term &quot;rapid transit&quot; internally to describe all four lines, but in public usage they are called subway lines, with the exception of the Scarborough RT, which is simply called &quot;the RT&quot;.

Current priorities for expansion is extending the western branch of the Yonge-University-Spadina line north of Toronto, creating a new line under Eglinton Avenue, and extending the Sheppard line in both directions from its current termini.

